              <FavoriteBorderIcon></FavoriteBorderIcon>
              <a href="#" class="cart-btn">
                add to cart
              </a>
              <a href="#" class="fas fa-share"></a>
            </div>
          </div>
          <div class="content">
            <h3>product</h3>
            <div class="price">
              LE 12.99 <span>LE 15.99 </span>{" "}
            </div>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default Product;
